import React, { Component } from 'react'
import { data } from './mock'
export default class Todo extends Component {

    state = {
        data,
    }
    render() {
        return (
            <div>

                {data.map((value) => {
                    return (<h1>
                        {value.id}-{value.name}

                    </h1>)
                })}
            </div>
        )
    }
}
